import styled from "styled-components";


const Container = styled("div")`
    width: 100vw;
    height 100px;
    background-color: #ffffff;

    display: flex;
    justify-content: center;
    align-items: center;

`

const Title = styled("h1")`
    margin: 0;
    font-weight: bold;

`

const Navbar = () => {
    return (
        <Container>
            <Title>
                MINT THE PASS
            </Title>
        </Container>
    )
}

export default Navbar;
